// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;
import "./ERC721.sol";


contract DutchAuction{
    uint public constant DURATION = 7 days;
    ERC721 public immutable nft;
    uint public immutable nftId;
    address payable public immutable seller;
    uint public immutable startingPrice;
    uint public immutable discount;
    uint public immutable startingAt;
    uint public immutable expiresAt;

    constructor(
        uint _startingPrice,
        uint _discount,
        address _nft,
        uint _nftId
    ){
        seller = payable(msg.sender);
        require(_startingPrice>0,"price <0");
        startingPrice = _startingPrice;
        discount = _discount;
        nft = ERC721(_nft);
        nftId = _nftId;
        startingAt = block.timestamp;
        expiresAt = block.timestamp+DURATION;
        require(_startingPrice-DURATION*_discount>=0,"discount too big");





    }


}

